#### Import the simple module from Paraview
from paraview.simple import *
import os

try:
    # Manually parse the active_sim.yaml file
    script_dir = os.getcwd()
    yaml_file = os.path.join(script_dir, "../active_sim.yaml")

    with open(yaml_file, "r") as file:
        lines = file.readlines()

    sim_folder = None
    prefix = None
    for line in lines:
        line = line.strip()
        if line.startswith("active_sim:"):
            sim_folder = line.split(":")[1].strip().strip('"')
        elif line.startswith("active_file_name:"):
            prefix = line.split(":")[1].strip().strip('"')

    if not sim_folder or not prefix:
        raise ValueError("Could not parse active_sim.yaml. Check the file for errors.")

    sim_folder = os.path.join("../simulations", sim_folder)
    print(f"Simulation folder: {sim_folder}")
    print(f"Prefix: {prefix}")

    # Construct the path to the para_dats directory
    para_dats_dir = os.path.join(sim_folder, "para_dats")
    if not os.path.exists(para_dats_dir):
        raise FileNotFoundError(f"Directory not found: {para_dats_dir}")

    # Generate the file list
    file_list = [
        os.path.join(para_dats_dir, f)
        for f in sorted(os.listdir(para_dats_dir))
        if f.startswith(prefix) and f.endswith(".dat")
    ]
    if not file_list:
        raise FileNotFoundError("No matching .dat files found.")

    print(f"Files to process: {file_list}")

    # Create a new 'Tecplot Reader' and pass the file list
    stClair = TecplotReader(
        registrationName=f"{prefix}*",
        FileNames=file_list
    )

except Exception as e:
    print("An error occurred:")
    traceback.print_exc()


